import React from 'react';
import './App.css';

const myList = ['apple', 'orange', 'banana'];

function App() {
  return (
    <div className="App">
      <p>Hello</p>
      {myList.map((item, index) => (
        <p key={index}>{item}</p>
      ))}
    </div>
  );
}

export default App;
